import React from "react";
import AboutMe from "../Img/about.jpg";
import "./About.css";
const About = () => {
  return (
    <div className="container">
      <div className="row h-info">
        <div className="col bg-danger text-start">
          <p className="fs-1 text text-center">Sobre mí</p>
          <span className=" ">
            Soy una persona que encontró su verdadera vocación, comencé
            realizando el bootcamp de Soy Henry, y luego para poder expandir mas
            mis conocimiento adquirir una membresía en la plataforma platzi, Me
            emociona aprender y estoy en contante copacitacion
          </span>
        </div>
        <div className="col-4 bg-info p-2 fs-6 text">
          <img className="img-fluid  img-thumbnail" src={AboutMe} />
          <div className="row">
            <div className="col">
              <p>
                Soy una persona que encontro su verdadera pacion Me emociona
                aprender y estoy en contante copacitacion
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
